  [],\n\t\"revision_timestamp\": \"2016-07-27T23:05:58.553929\",\n\t\"name\": \"pacific-remote-islands-mnm-initial-survey-instructions-for-seabird-colony-survey\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of the seabird survey is to
  assess, to the extent possible within the period of time available ashore, the species
  composition, number of adults, number of active nests (eggs or chicks), and phenology
  (chick stage) of resident seabirds. The surveys primarily support Objective 3a in
  the CCPs of Howland Island, Baker Island, and Jarvis Island NWRs: Develop baseline
  migratory bird and other species information. This objective, in turn, pertains
  to the goal of contributing to the recovery, protection, and management efforts
  for all native species with special consideration for seabirdsu2026and species of
  management concern. Howland Island, Baker Island, and Jarvis Island NWRs were each
  established for the purpose of restoring and protecting the complete ecosystem,
  both terrestrial and marine, with special consideration given to the protection
  of nesting seabird populations. The purpose of the Baker Island NWR as articulated
  in its CCP additionally directs that priority be given to allow seabird nesting
  colonies to re-establish themselves so eventually they would reach the great numbers
  which were present there prior to human occupancy and abuse of the island during
  the past 125 years.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
